import Link from 'next/link';

const recipeContainer = {
	display: 'inline-block',
	margin: '0.25%',
	padding: '0.25%',
	width: '32%',
	height: '10em',
	border: '1px solid black'
}

const Recipe = (props) => (
  <div style={recipeContainer}>
  	{props.title}
  </div>
);

export default function Recipes() {
  return (
    <div>
    	<Recipe title="BBQ Pork Mac & Cheese" />
    	<Recipe title="Chili" />
    	<Recipe title="German Potato Soup" />
    	<Recipe title="Salmon with Tomato & Lemon" />
    	<Recipe title="Sausage & Peppers" />
    	<Recipe title="Southwestern Quesadilla" />
    </div>
  );
};
